import logo from './logo.svg';
import './App.css';


const headerStyle = {
  color: 'white'
};

const subheaderStyle = {
  color: 'white'
};

const Section1 = {
  backgroundColor: 'white'
};


const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <Section1 />
        <h1 style={headerStyle}>
          Josephine Lo
        </h1>

        <h2 style={subheaderStyle}>
          About Me
        </h2>

        <h2 style={subheaderStyle}>
          Projects
        </h2>

        <h2 style={subheaderStyle}>
          Experience
        </h2>



        {/* <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
    </div>
  );
}

export default App;
